*{
    padding: 0;
    margin: 0;
    font-family: sans-serif;
}

.container{
    width: 100%;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
}

.card{
    width: 400px;
    height: auto;
    overflow: hidden;
    position: absolute;
    top: 15%;
    left: 35%;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    border-radius: 10px;
}

.image img{
    width: 100%;
    -webkit-filter: blur(24px);
            filter: blur(24px);
    transition: 0.3s linear;
}

.card span{
    position: absolute;
    top: 35%;
    left: 8%;
    font-size: 1.7rem;
    width: 330px;
    text-align: center;
    color: white;
    text-shadow: 0 0 10px black;
    transition: 0.3s linear;
}

.btn{
    position: absolute;
    bottom: 88px;
    right: 30px;
    background: #333;
    color: white;
    padding: 10px;
    font-size: 15px;
    border-radius: 6px;
    cursor: pointer;
    transition: 0.3s linear;
}
